package main

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func Test_isSubsequence(t *testing.T) {

	cases := map[string]struct {
		text        string
		subsequence string
		expected    bool
	}{
		// "Should text:ahbgdc sub: axc": {
		// 	expected:    false,
		// 	text:        "ahbgdc",
		// 	subsequence: "axc",
		// },
		// "Should text:ahbgdc sub: abc": {
		// 	expected:    true,
		// 	text:        "ahbgdc",
		// 	subsequence: "abc",
		// },
		// "Should text:baab sub: ab": {
		// 	expected:    true,
		// 	text:        "baab",
		// 	subsequence: "ab",
		// },
		"shoudl return true": {
			expected:    true,
			subsequence: "leeeeetcode",
			text:        "",
		},
	}

	for name, cs := range cases {
		t.Run(name, func(t *testing.T) {
			data := isSubsequence(cs.subsequence, cs.text)

			assert.Equal(t, cs.expected, data)
		})
	}
}
